(102, 0, 0, 0, 0, '', '', '', 'Chính sách bảo mật', 'chinh-sach-bao-mat', 'Chính sách bảo mật', '', 18, 3, 1, 0, 1567599604, 0, 'Chính sách bảo mật', 'Chính sách bảo mật', 'Chính sách bảo mật', 0, '', '', '', 'chinhsach', ''),
(103, 0, 0, 0, 0, '40172949_1649212125208634_6085966098631491584_o-5496.jpg', '40172949_1649212125208634_6085966098631491584_o3777_280x220.jpg', '', 'Chuyện của CHICKA CHICKA', 'chuyen-cua-chicka-chicka', '<blockquote>\r\n<p><span style="font-family: elle-futura; font-size: 18px;">ChickaChicka được thành lập ngẫu nhiên bởi Quỳnh và Tuyết. </span><span style="font-family: elle-futura; font-size: 18px;">Thân nhau, chúng tôi muốn làm gì đó cùng nhau. Suy nghĩ lúc ấy rất đơn giản, muốn làm quần áo, muốn ai cũng có đồ đẹp để mặc.</span></p>\r\n\r\n<p> </p>\r\n\r\n<p><span style="font-family: elle-futura; font-size: 18px;">Chicka không phải là một từ gì đó mang ý nghĩa cụ thể. </span><span style="font-family: elle-futura; font-size: 18px;">Bạn mặc Chicka, hiểu Chicka như thế nào thì chính là ý nghĩa như vậy, hãy giữ suy nghĩ và định nghĩa đó theo cách của mình. </span></p>\r\n\r\n<p> </p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><span style="font-family: elle-futura; font-size: 18px;">Chicka không theo xu hướng nào quá đặc biệt. Áo váy chúng tôi làm ra chỉ mong muốn mang đến cho bạn cảm giác thú vị, tự tin là chính mình nhất. Các thiết kế phần lớn được làm từ những chất liệu nhẹ nhàng, thoáng mát đủ để khiến bạn cảm thấy mình hạnh phúc vì được là con gái, mình thu hút và yêu bản thân mình thật nhiều, vậy thôi!</span></p>\r\n</blockquote>\r\n', '<blockquote>\r\n<p> </p>\r\n</blockquote>\r\n\r\n<p> </p>\r\n', 0, 1, 1, 0, 1567601257, 1570070411, '', '', '', 0, '', '', '', 'stories', '');
